import React from 'react';
import classes from './posts-page.module.css';
import Post from '../post/post';
import { Contextt } from '../../app2';

export default () => {
    return (
        <Contextt.Consumer>
            {(obj) => { obj.posts.map((v) => <Post />)}}
        </Contextt.Consumer>
    );
}
